from mnist import MNIST
import random
import numpy as np
import time
mndata = MNIST('C:/Users/win10/Desktop/sample')
def tau(y1,y2,f):
    j = [0 for i in range(len(y1)) ]
    for i in range(len(y1)):
        j[i] = y1[i] - y2[i]
    return ((np.dot(j,f) + 1)/(2 * np.dot(f,f)))
images, labels = mndata.load_training()
testImages,testLables = mndata.load_testing()
for i in range(len(images)):
    images[i] += [1] #bias
for i in range(len(testImages)):
    testImages[i] += [1] #bias
w = [[0 for i in range(len(images[0]))] for j in range(10)] # weight
w[0][0] = 1 #bias
for i in range(1,len(w)):
    w[i][0] = 0
# training:
counter = 0
a = time.time()
# while(counter < 10):
for i in range(len(images)):
    # print("iteration ", i, " time : ", time.time() - a)
    max = 0
    index = 0
    for j in range(len(w)):
        temp = np.dot(w[j], images[i])
        if temp > max:
            max = temp
            index = j
    if index != labels[i]:
        t = tau(w[index], w[labels[i]], images[i])
        for j in range(len(w[index])):

            w[index][j] -= t * images[i][j]
            w[labels[i]][j] += t * images[i][j]
counter += 1
# print("counter : ", counter, " and time is ", time.time() - a)
print(w)
#testing:
correct = 0
for i in range(len(testImages)):
    print("iteration2 ", i, " time : ", time.time() - a)
    max = 0
    index = 0
    for j in range(len(w)):
        temp = np.dot(w[j],testImages[i])
        if temp > max:
            max = temp
            index = j
    if index == testLables[i]:
        correct += 1
print("the correctness ratio is: ",correct/100)
